INSERT INTO `com_order` VALUES (52,'重庆测试',71,'2015-06-12 11:19:48','重庆测试',8,2,NULL,0,NULL,0,NULL,NULL),(55,'老人桌面事宜',65,'2015-06-12 14:25:07','200004430&nbsp;&nbsp;15878838898来电反映此手机用老人桌面拨打电话经常闪退，手机型号为R831S，已让用户清除缓存，再关机重启，但还是在拨打电话时闪退',30,2,NULL,2,NULL,0,NULL,NULL),(56,'中山移动卡开不了户',70,'2015-06-12 15:26:16','现中山移动卡因网页显示“号码在保护名单中，不符合办理条件”原因开不了卡，导致影响审核开卡进度，请尽快处理，谢谢！',42,2,NULL,2,NULL,0,NULL,'2015-06-25 11:42:42'),(57,'测试',64,'2015-06-16 19:33:24','11111111111111111111111111111111111111111111111111111111111111111111111',8,3,NULL,0,16,0,NULL,NULL),(63,'平台故障',65,'2015-06-19 11:04:56','你好!现时一点通平台出现:有时SOS呼入抢不了线,平台调出数据缓慢,麻烦梁总帮忙处理,谢谢!',21,2,NULL,0,NULL,0,NULL,NULL),(64,'330054404用户无法拨打电话',94,'2015-06-21 21:10:02','&nbsp;现接到用户编号:&nbsp;330054404&nbsp;,手机号码:13823953465反映手机今天突然不能拨打电话，显示正在注册中.可以正常接听电话.版本:2014-08-26,用户三码与营销系统一致,移动网正常.已经指导用户恢复出厂设置后,我的信息里面还是无法读取到用户的手机号码:用户可以正常接听,拨打电话时提示正在注册中.,地图定位从中午之后就一直是离线状态.没有二代卡提交记录.可回复:18746607220联系用户.用户表示要赶紧处理好.请梁总和国靖帮忙处理，谢谢!',26,2,NULL,0,36,0,NULL,NULL),(65,'中山卡黑名单',91,'2015-06-23 09:26:21','&nbsp;大家好，现时中山移动卡无法开通来电显示功能，经后勤人员致电10086客服得知中山卡现处于黑名单状态，已告知通信商务部主管何卓华告知情况，此情况客服会继续跟进。现通报各位！\n\n\n',41,2,NULL,0,23,0,NULL,NULL),(66,'平台不显示用户资料框',98,'2015-06-23 17:53:01','安徽客服部接到一位15822365059来电呼叫类型显示是SOS，但是无法弹出用户资料框，显示是新潜在用户，请帮忙处理，谢谢！',18,1,NULL,0,NULL,0,NULL,NULL),(67,'子女端APP拨打不了电话',95,'2015-06-23 20:10:35','&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;用户330031490来电反映其联系人子女端13783348273拨打不了电话,一直正在呼叫,用户表示电话手机已开通30M以上的数据流量功能,来电显示功能,接听电话免费功能,其表示手机能正常上网。\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;他的手机是红米2A是双卡双待的,卡槽1放的是13783348273(联系人电话),其子女端已经是1.10版本。\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;建议用户连接WIFI的情况下拨打,随后致电用户表示连接WIFI情况下还是拨打不了电话，还是提示正在呼叫，请跟进处理，谢谢！',32,1,NULL,0,13,0,NULL,NULL),(68,'一点通平台录音异常',88,'2015-06-24 11:14:45','现时一点通平台全部录音都不能正常监听，请帮忙处理，谢谢！',15,2,NULL,0,24,0,NULL,NULL),(69,'不能绑定子女端APP',98,'2015-06-24 13:32:40','1.13703803061来电反映在绑定子女端APP的时候提示“不在该用户的紧急联系人里面，请联系95105886，但是用户需要绑定使用APP的手机号码&nbsp;13849610959已经是330063277&nbsp;的第一紧急联系人，并且在一点通平台是唯一的紧急联系人，需要绑定使用子女端APP的机型是金立182。请马总帮